import axios from "axios";
import ls from 'local-storage';

const url = "http://localhost.com"

export const userFetchLocal = () => {
    return ls.get('user');
}

export const signupApi = (email,password) =>{
    const apiString = url+"/api/user/create"
    axios.post(apiString,{
        email,
        password
    })
    .then(({
        data
    }) => {
        console.log(data)
    }).catch(err => {
        console.log(err)
    });
}
